import React from 'react'

const Card = ({ id, name, username, email }) => {
  return (
    <div
      key={id}
      className="drop-shadow-md container mx-auto sm:px-6 lg:px-8 w-1/2 my-4"
    >
      <div className="bg-green-300 border border-stone-500 rounded-lg flex flex-col items-center justify-center">
        <img
          className="border border-stone-500 rounded-lg"
          src={`https://robohash.org/${id}?200x200`}
          alt="robots"
        />
        <div>
          <h1>{username}</h1>
          <h2>{name}</h2>
          <p>{email}</p>
        </div>
      </div>
    </div>
  )
}

export default Card;
